import React from 'react'
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate()
  const isLoggedIn = localStorage.getItem('isLoggedIn');
  if (!(isLoggedIn && isLoggedIn === "true")) {
    navigate("/login")
  }
  return (
    <div>Home</div>
  )
}

export default Home
